using System;
using System.Collections.Generic;
using System.Text;

namespace LeetCodeTest.Tests
{
    /// <summary>
    /// Given a non-empty string s, you may delete at most one character. 
    /// Judge whether you can make it a palindrome.
    /// </summary>
    class Valid_Palindrome_II : ISolution, IEasy, IComplete
    {
        public string Method()
        {
            var s = //"";
                    //"abc";
                    //"";
                    //"cbbcc";
                    "";
                    //"abca";
            return ValidPalindrome(s).ToString();
        }

        public bool ValidPalindrome(string s)
        {
            if (string.IsNullOrEmpty(s) || s.Length == 1)
                return true;

            for (int i = 0; i < s.Length - 1; i++)
            {
                int l = s.Length - 1 - i;
                if (s[i] != s[l])
                {
                    string s1 = s.Remove(i, 1);
                    string s2 = s.Remove(l, 1);
                    return (DoValidPalindrome(s1) || DoValidPalindrome(s2));
                }
            }
            return true;
        }

        private bool DoValidPalindrome(string s)
        {
            int i = 0;
            int j = s.Length - 1;
            while (i < j)
            {
                if (s[i] != s[j])
                    return false;

                i++;
                j--;
            }
            return true;
        }
    }
}
